def fitness_calculate(temp_ch):
    c1=0
    sum_delay=0
    list_help=[]
    l_list=len(list_help)
    for i in range (0,len(data)):
        if(data[i][0]==temp_ch[0] and data[i][1]==temp_ch[1]  and data[i][2]==temp_ch[2] and data[i][3]==temp_ch[3] and data[i][4]==temp_ch[4] and data[i][5]==temp_ch[5]):
            c1=c1+1
            sum_delay=sum_delay+data[i][6]
            list_help.append(data[i][6])
            l_list=len(list_help)
    #print("count1 =",c1)
    #print(sum_delay)
    if(c1!=0):a1=sum_delay/c1
    else: a1=0
   # print("Avg1 =",a1)
    #print(len(list_help))
    j=0
    pow_diff=0
    s1=0
    for j in range (0,l_list):
        pow_diff= pow_diff+pow((list_help[j]-a1),2)
    if(l_list!=0):
        s1=sqrt(pow_diff/l_list)
        #print("SD1 =",s1)
   
    #entekhab nashode

    c2=0
    summ_delay=0
    list_helpp=[]
    l_listt=len(list_helpp)
    #print(len(list_helpp))
    for i in range (0,len(data)):
        if(data[i][0]!=temp_ch[0] or data[i][1]!=temp_ch[1] or data[i][2]!=temp_ch[2] or data[i][3]!=temp_ch[3] or data[i][4]!=temp_ch[4] or data[i][5]!=temp_ch[5]):
            c2=c2+1
            summ_delay=summ_delay+data[i][6]
            list_helpp.append(data[i][6])
            l_listt=len(list_helpp)
    #print("count2 =",c2)
    #print(summ_delay)
    if(c2!=0):a2=summ_delay/c2
    else: a2=0
   # print("Avg2 =",a2)
    #print(len(list_helpp))
    j=0
    poww_diff=0
    s2=0
    start=0
    end=0
    for j in range (0,l_listt):
        poww_diff = poww_diff+pow((list_helpp[j]-a2),2)
    if(l_list!=0):
        s2=sqrt(poww_diff/l_listt)
      #  print("SD2 =",s2)
    

    if(c1!=0 and c2!=0):
        start=(a1-a2)+(1.96*sqrt((pow(s1,2)/c1)+(pow(s2,2)/c2)))
    #else:
     #   start=0
    if(c1!=0 and c2!=0):
        end=(a1-a2)-(1.96*sqrt((pow(s1,2)/c1)+(pow(s2,2)/c2)))
  #  else:
  #      end=0
   # print("diff+ :",start)
   # print("diff- :",end)
    
    #bayad hame fitness ha save shavad ta behtarin entekhab shavad!
    fitness=0
    if(start*end)>=0:
        if(start>0):
            fitness=abs(min(start,end)-0)
        else:
            fitness=abs(max(start,end)-0)
    #print(fitness)
    return (fitness,a1)
