############### change bit:
def change_bit(g):
    if(g==1):
        g=0
    else:
        g=1
    return (g)

############################# CROSSOVER:
def crossover(p1,p2):
    
    c_index = randrange(1,5)
    child_1 = p1[:c_index] + p2[c_index:6]
    child_2 = p2[:c_index] + p1[c_index:6]
    
    return(child_1,child_2) 

############################# MUTATION:
def mutation(p1):
    
    child_m=p1[:6]
    
    g0=random()
       ## print(g0)
    if(g0>=0.5):
        child_m[0]=change_bit(child_m[0])
    g1=random()
       ## print(g1)
    if(g1>=0.5):
        child_m[1]=change_bit(child_m[1])
    g2=random()
      ##  print(g2)
    if(g2>=0.5):
        child_m[2]=change_bit(child_m[2])
    g3=random()
      ##  print(g3)
    if(g3>=0.5):
        child_m[3]=change_bit(child_m[3])
    g4=random()
      ##  print(g4)
    if(g4>=0.5):
        child_m[4]=change_bit(child_m[4])
    g5=random()
      ##  print(g5)
    if(g5>=0.5):
        epsilon=randrange(1,3)
        if(g5>=0.75):
            child_m[5]=child_m[5]+epsilon
        else:
            child_m[5]=child_m[5]-epsilon
    
    return child_m
    
